import React from 'react';

function Profile() {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>Your Profile</h1>
            <p>Welcome to your profile! Here you can manage your favorite genres and book lists.</p>
        </div>
    );
}

export default Profile;
